if mibBuilder.loadTexts: docsIfUpChannelUpdate.setDescription("Used to perform the transfer of adjusted SCDMA parameters from the temporary upstream row to the active upstream row indicated by the docsIfUpChannelCloneFrom object. The transfer is initiated through an SNMP SET of TRUE to this object. The SNMP SET will fail with a GEN_ERROR (snmpv1) or COMMIT_FAILED_ERROR (snmpv2c/v3) if the adjusted SCDMA parameter values are not compatible with each other. Although this object was created to facilitate SCDMA parameter adjustment, it may also be used at the vendor's discretion for non-SCDMA parameter adjustment. An SNMP GET of this object always returns FALSE.")
docsIfUpChannelStatus = MibTableColumn((1, 3, 6, 1, 2, 1, 10, 127, 1, 1, 2, 1, 18), RowStatus()).setMaxAccess("readcreate")
if mibBuilder.loadTexts: docsIfUpChannelStatus.setStatus('current')
if mibBuilder.loadTexts: docsIfUpChannelStatus.setDescription("This object is generally intended to be used for the creation of a temporary inactive upstream row for the purpose of adjusting the SCDMA channel parameters of an active upstream row. The recommended procedure is: 1) Create an inactive row through an SNMP SET using createAndWait(5). Use an ifIndex value outside the operational range of the system. 2) Set the docsIfUpChannelCloneFrom field to the ifIndex value of the active row whose SCDMA parameters require adjustment. 3) Adjust the SCDMA parameter values using the new temporary inactive row. 4) Update the active row by setting object docsIfUpChannelUpdate to TRUE. This SET will fail if the adjusted SCDMA parameters are not compatible with each other. 5) Delete the temporary row through an SNMP SET using DELETE. The following restrictions apply to this object: 1) This object must contain a value of active(1) for active rows. 2) Temporary inactive rows must be created using createAndWait(5). 3) The only possible status change of a row created using createAndWait(5) (ie notInService(2)) is to destroy(6). These temporary rows must never become active. 4) A status transition from active (1) to destroy (6) is not permitted. Entries with docsIfUpChannelStatus set to active(1) are logically linked to a physical interface, not temporarily created to clone parameters. The Interface MIB [RFC2863] ifAdminStatus should be used to take an Upstream Channel offline. Although this object was created to facilitate SCDMA parameter adjustment, it may also be used at the vendor's discretion for non-SCDMA parameter adjustment.")
